import React, { useEffect, useState, useCallback } from "react";
import { fetchJobs, checkApiHealth, testCors } from "../services/api";
import JobCard from "../components/JobCard";
import '../styles/JobsPage.css';

const JobsPage = () => {
  const [jobs, setJobs] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const [healthStatus, setHealthStatus] = useState(null);
  const [corsStatus, setCorsStatus] = useState(null);
  const [debugInfo, setDebugInfo] = useState({});
  
  // Use useCallback to memoize the getJobs function
  const getJobs = useCallback(async () => {
    try {
      setLoading(true);
      
      console.log("Fetching jobs with debug info:", debugInfo);
      
      // Try to fetch jobs using the multi-method approach from our updated API client
      const jobsData = await fetchJobs();
      
      if (Array.isArray(jobsData) && jobsData.length > 0) {
        console.log(`Successfully fetched ${jobsData.length} jobs:`, jobsData[0]);
        setJobs(jobsData);
        setError(null); // Clear any previous errors
      } else if (Array.isArray(jobsData) && jobsData.length === 0) {
        console.log("Successfully connected to API but no jobs were found");
        setJobs([]);
        setError(null); // Clear any previous errors
      } else {
        console.error("Unexpected response format:", jobsData);
        setError(`Received invalid data format from API: ${JSON.stringify(jobsData).slice(0, 100)}...`);
      }
    } catch (error) {
      console.error("Error fetching jobs:", error);
      
      // More detailed error message based on the error type
      if (error.message?.includes("Network Error") || error.message?.includes("Failed to fetch")) {
        setError("Network error: Could not connect to server. Please check if the API server is running and accessible.");
      } else if (error.response?.status === 401) {
        setError("Authentication error: You must be logged in to view jobs.");
      } else if (error.response?.status === 403) {
        setError("Permission error: You don't have access to view these jobs.");
      } else if (error.response?.status === 500) {
        setError("Server error: The server encountered an internal error. Please try again later.");
      } else {
        setError(`Error: ${error.message || "Unknown error"}`);
      }
    } finally {
      setLoading(false);
    }
  }, [debugInfo]); // Add debugInfo as a dependency
  
  useEffect(() => {
    const initializeData = async () => {
      // Collect debug info first
      const debug = {
        url: process.env.REACT_APP_API_BASE_URL || "Not set in environment",
        browser: navigator.userAgent,
        timestamp: new Date().toISOString(),
        origin: window.location.origin
      };
      setDebugInfo(debug);
      console.log("Debug info:", debug);
      
      // Test steps in sequence to better isolate issues
      try {
        // Step 1: Test CORS configuration
        console.log("Step 1: Testing CORS configuration...");
        const cors = await testCors();
        setCorsStatus(cors);
        
        if (!cors.ok) {
          console.warn("CORS test failed:", cors);
          // Continue to health check even if CORS test fails
        } else {
          console.log("CORS test passed:", cors);
        }
        
        // Step 2: Check API health
        console.log("Step 2: Checking API health...");
        const health = await checkApiHealth();
        setHealthStatus(health);
        
        if (!health.ok) {
          console.warn("API health check failed:", health);
          setError(`API health check failed: ${health.error || 'Unknown error'}`);
          // Continue to fetch jobs even if health check fails
        } else {
          console.log("API health check passed:", health);
        }
        
        // Step 3: Fetch jobs regardless of previous steps
        console.log("Step 3: Fetching jobs...");
        await getJobs();
        
      } catch (error) {
        console.error("Initialization error:", error);
        setError(`Initialization error: ${error.message || "Unknown error"}`);
        setLoading(false);
      }
    };
    
    initializeData();
  }, [getJobs]); // Add getJobs as a dependency
  
  const handleTryAgain = () => {
    getJobs();
  };

  const handleTestCors = async () => {
    try {
      const result = await testCors();
      setCorsStatus(result);
      
      if (result.ok) {
        alert(`CORS test successful! Response: ${JSON.stringify(result.data)}`);
      } else {
        alert(`CORS test failed: ${result.error}`);
      }
    } catch (err) {
      alert(`CORS test error: ${err.message}`);
    }
  };

  // Loading state
  if (loading) {
    return (
      <div className="jobs-container loading">
        <h2>Loading available jobs...</h2>
        <div className="loader"></div>
        <p>Checking connection to: {debugInfo.url}</p>
      </div>
    );
  }

  // Error state with debugging info
  if (error) {
    return (
      <div className="jobs-container error">
        <h2>Oops! Something went wrong</h2>
        <p>{error}</p>
        
        {/* Debugging information */}
        <div className="debug-info">
          <h3>Debug Information</h3>
          <ul>
            <li><strong>API URL:</strong> {debugInfo.url}</li>
            <li><strong>Your Origin:</strong> {debugInfo.origin}</li>
            <li><strong>CORS Test:</strong> {corsStatus ? 
              (corsStatus.ok ? "Passed" : `Failed: ${corsStatus.error || 'Unknown error'}`) : 
              "Not run"}
            </li>
            <li><strong>Health Check:</strong> {healthStatus ? 
              (healthStatus.ok ? "Passed" : `Failed: ${healthStatus.error || 'Unknown error'}`) : 
              "Not run"}
            </li>
            <li><strong>Browser:</strong> {debugInfo.browser}</li>
            <li><strong>Time:</strong> {debugInfo.timestamp}</li>
          </ul>
        </div>
        
        {/* CORS Troubleshooting Guide */}
        <div className="troubleshooting">
          <h3>CORS Issues?</h3>
          <p>If you're experiencing CORS errors, try these steps:</p>
          <ol>
            <li>Verify that your backend CORS configuration includes <code>{debugInfo.origin}</code> as an allowed origin</li>
            <li>Check that your API is running and accessible at <code>{debugInfo.url}</code></li>
            <li>Try accessing the API directly by visiting <a href={`${debugInfo.url}/health`} target="_blank" rel="noopener noreferrer">Health Check Endpoint</a></li>
          </ol>
        </div>
        
        {/* Testing buttons */}
        <div className="debug-actions">
          <button onClick={handleTestCors} className="debug-button">
            Test CORS Configuration
          </button>
          
          <button onClick={handleTryAgain} className="retry-button">
            Try Again
          </button>
        </div>
      </div>
    );
  }

  // Success state
  return (
    <div className="jobs-container">
      <h2>Available Jobs</h2>
      {jobs.length === 0 ? (
        <div className="no-jobs">
          <p>No jobs are currently available. Please check back later.</p>
          <div className="debug-info small">
            <p><strong>API URL:</strong> {debugInfo.url}</p>
            <p><strong>CORS Status:</strong> {corsStatus?.ok ? "Passed" : "Failed"}</p>
            <p><strong>Health Status:</strong> {healthStatus?.ok ? "Passed" : "Failed"}</p>
          </div>
          <button onClick={handleTryAgain} className="retry-button">
            Refresh Jobs
          </button>
        </div>
      ) : (
        <div className="jobs-list">
          {jobs.map((job) => (
            <JobCard key={job.job_id} job={job} />
          ))}
        </div>
      )}
    </div>
  );
};

export default JobsPage;
